    false,nt"url": null,nt"notes": "This narrative report for Sand Lake NWR
    and the easement refuges outlines Refuge accomplishments from January through April
    of 1957. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    grazing, haying, and fur harvesting. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and fishing.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
